 5 Phyloseq Objects Demo Datasets In this section, we are presenting the process of importing authentic preprocessed data, which will serve as the cornerstone for our subsequent analyses. Although synthetic data certainly has its advantages, it can at times introduce biases or limitations that do not fully capture the intricate diversity inherent in real microbiome samples. 5.1 The GlobalPatterns dataset The GlobalPatterns dataset, sourced from the Earth Microbiome Project (EMP), serves as a comprehensive repository for studying microbial communities worldwide. Here’s a breakdown of its key attributes: Source: GlobalPatterns originates from the Earth Microbiome Project (EMP), collecting samples worldwide. Composition: It comprises high-throughput sequencing data, revealing the taxonomic composition of microbial communities. Scope: Samples represent diverse global ecosystems, offering a comprehensive view of microbial biodiversity. Format: Presented as a phyloseq object in R, it integrates sample metadata and taxonomic abundance for analysis. Utility: Researchers utilize it for community profiling, abundance testing, and ecological modeling, enhancing understanding of global microbial diversity and function. library(phyloseq) # for GlobalPatterns dataset data(&quot;GlobalPatterns&quot;) ps_GlobalPatterns &lt;-GlobalPatterns df_GlobalPatterns &lt;-GlobalPatterns %&gt;% phyloseq::psmelt() %&gt;% tibble::rownames_to_column(&quot;sample_id&quot;) %&gt;% rename_all(tolower) colnames(df_GlobalPatterns) [1] &quot;sample_id&quot; &quot;otu&quot; [3] &quot;sample&quot; &quot;abundance&quot; [5] &quot;x.sampleid&quot; &quot;primer&quot; [7] &quot;final_barcode&quot; &quot;barcode_truncated_plus_t&quot; [9] &quot;barcode_full_length&quot; &quot;sampletype&quot; [11] &quot;description&quot; &quot;kingdom&quot; [13] &quot;phylum&quot; &quot;class&quot; [15] &quot;order&quot; &quot;family&quot; [17] &quot;genus&quot; &quot;species&quot; cat(&quot;
&quot;) ps_GlobalPatterns phyloseq-class experiment-level object otu_table() OTU Table: [ 19216 taxa and 26 samples ] sample_data() Sample Data: [ 26 samples by 7 sample variables ] tax_table() Taxonomy Table: [ 19216 taxa by 7 taxonomic ranks ] phy_tree() Phylogenetic Tree: [ 19216 tips and 19215 internal nodes ] 5.2 The dietswap dataset The dietswap dataset, available through the microbiome R package, offers valuable insights into the effects of dietary interventions on microbial communities. Here’s an overview of its attributes: Source: The dietswap dataset is derived from research examining the impact of dietary changes on the human gut microbiome. Composition: It comprises high-throughput sequencing data, providing insights into the taxonomic composition and dynamics of microbial communities in response to dietary alterations. Scope: Samples are obtained from human participants undergoing dietary interventions, enabling researchers to explore how different diets influence microbial diversity and function within the gut microbiome. Format: Presented in a format suitable for microbiome analysis, the dataset includes sample metadata and taxonomic abundance data, facilitating comprehensive analyses of microbial community dynamics. Utility: Researchers utilize the dietswap dataset to investigate the effects of dietary interventions on gut microbiome composition, contributing to a better understanding of the intricate interactions between diet, host physiology, and microbial ecology. library(microbiome) # for dietswap dataset data(&quot;dietswap&quot;) dietswap phyloseq-class experiment-level object otu_table() OTU Table: [ 130 taxa and 222 samples ] sample_data() Sample Data: [ 222 samples by 8 sample variables ] tax_table() Taxonomy Table: [ 130 taxa by 3 taxonomic ranks ] Note: dietswap is missing the phylo_tree slot, we can construct it and add it like so: library(microbiome) data(&#39;dietswap&#39;) ps_raw_basic &lt;- dietswap library(ape) ps_tree = rtree(ntaxa(