 7 Create psExtra Objects After the creation of phyloseq objects, we proceed to create psExtra objects using functionalities provided by the microViz package. The psExtra objects extend the capabilities of phyloseq objects by incorporating additional metadata, experimental conditions, or statistical results, enhancing the depth and breadth of analyses performed using microbiome data. 7.1 Prerequisite Before creating psExtra objects, it’s essential to have pre-existing phyloseq objects containing microbiome data and associated metadata. These phyloseq objects serve as the input data for creating psExtra objects. For example, pre-existing phyloseq objects such as ps_dietswap, ps_GlobalPatterns, ps_caporaso, and ps_kostic_crc prepared in the previous sections should be available. 7.2 Load pre-existing phyloseq objects load(&quot;data/phyloseq_objects.rda&quot;, verbose = TRUE) Loading objects: ps_GlobalPatterns ps_dietswap ps_caporaso ps_kostic_crc 7.3 Load pre-existing phyloseq objects # Load required packages library(phyloseq) # For handling microbiome data library(microViz) # For advanced microbiome visualization # Assuming ps_dietswap is already loaded or available # Aggregate taxonomic data psextra_clr_dietswap &lt;- tax_agg( ps = ps_dietswap, rank = &quot;Genus&quot;) %&gt;% tax_transform(trans = &quot;clr&quot;) # Display a subset of the transformed data cat(&quot;
